import React from 'react';
import '../styles/footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <p>efcon © 2025</p>
      <div>
        <a href="#">Документация</a>
        <a href="#">Поддержка</a>
        <a href="#">Контакты</a>
      </div>
    </footer>
  );
};

export default Footer;
